INSERT INTO `catalog_pages` (`id`, `parent_id`, `caption`, `icon_image`, `visible`, `enabled`, `min_rank`, `min_vip`, `order_num`, `page_link`, `page_layout`, `page_strings_1`, `page_strings_2`) VALUES
(1, -1, 'Rabbit VoorPagina', 213, '1', '1', 1, 0, 1, '', 'frontpage4', 'catalog_frontpage_headline_shop_GENERAL|', '<i><b><font color="#0E668C" size="16">Wat kan ik vinden in de Shop?</font></b></i><br><br>Upgrade je kleding met Rabbit Club, keur een huisdier of versier je kamer van de manier waarop je het leuk. Wat je het liefste wilt doen in Rabbit, zul je een manier om die ervaring nog beter te maken door te bladeren door onze winkel.<br><br><li>Join <a href="event:catalog/open/habbo_club">Rabbit Club</a></li><li><a href="event:catalog/open/set_pixelnew">Decorete </a>Jouw Kamer</li><li>Adopteer een <a href="event:catalog/open/pets_shop">Dier</a> of een <a href="event:catalog/open/bots">Bot</a></li><li>Maak je eigen <a href="event:catalog/open/category_wired">Wired</a> Games </li><li>Handel in onze <a href="event:catalog/open/marketplace_offers">Marketplaats</a></li><br><i><b><font color="#0E668C" size="16">Waar kan ik credits krijgen/Kopen?</font></b></i><br><br>We hebben een paar van de betaalmethoden zoals creditcards en PayPal die u toelaten om credits te kopen in onze webshop.<br><br><a href="http://rabbithotel.nl/shop" target="_new">Bezoek onze Shop pagina voor meer info.</a>|Verzilver je voucher code hier:'),
(3, -1, 'Klassieke Meubels', 2, '0', '0', 1, 0, 14, '', 'default_3x3', 'catalog_frontpage_headline2_en|', '|'),
(4, -1, 'Pixel Shop', 5, '0', '0', 1, 0, 24, '', 'default_3x3', 'catalog_frontpage_headline2_en|', '|'),
(5, -1, 'Rabbit Club', 172, '1', '0', 1, 0, 3, 'habbo_club', 'recycler_info', 'habboclub_2|VIP_badge', 'Rabbit Club is gratis en je krijgt het wanneer u begint. Hoewel je VIP kunt kopen Lees meer daarover hieronder.|VIP is beschikbaar vanaf http://rabbithotel.nl/shop voor 2,50 euro\\r\\r\r\nJe krijgt de volgende functies met VIP:\\r\r\nPush/Pull command,VIP Catalogus waaronder coole rares\\r\r\nEn hopen van coole andere functies. Dus waarom koop je het nu niet?\\r'),
(6, -1, 'Zilver VIP', 196, '1', '1', 1, 1, 30, '', 'default_3x3', 'vipheader1|vipteaser2', 'Hartelijk dank voor de aanschaf van VIP! Dit deel van de catalogus is speciaal voor onze VIP - gebruikers. De Rares in deze sectie zijn niet goedkoop, maar je kunt ze verkopen aan niet- VIP-leden voor een veel heftier prijs!|! Klik op een item voor meer informatie.'),
(7, 5, 'Koop Club', 75, '0', '0', 1, 0, 3, '', 'default_3x3', 'habboclub|catalog_hc_teaser', 'Rabbit Club komt met vele bonussen! Meer haar en kleding keuzes, meer haar en kleren kleuren te komen, nieuwe kamer lay-outs, nieuwe dansen, en nog veel, veel meer!|'),
(8, 5, 'Club Shop', 172, '1', '1', 1, 0, 20, '', 'default_3x3', 'catalog_header_hc|hc_catalog_teaser', 'Als je lid bent van Rabbit Club, kan je winkelen uit deze selectie van exclusieve items.'),
(9, -1, 'Bots', 65, '1', '1', 1, 0, 16, 'bots', 'bots', 'catalog_bots_headline1_en|catalog_bots_headline1_en', 'Ze lopen, ze praten, en ze maken de perfecte aanvulling op elke kamer| Kies een bot van uw fantasie/Opmerking: U kunt uw bot aanpassen zodra ze in uw kamer is!'),
(10, -1, 'Marketplaats', 69, '0', '0', 1, 0, 27, '', 'pets3', 'catalog_marketplace_header_en|catalog_note_marketplace', 'The Rabbit Marketplace is a convenient and safe way to buy and sell items in Rabbit.|How does the Rabbit Marketplace work?|Selling items: You can sell any item which is tradable by selecting the item in your inventory and clicking on "Sell in Marketplace". You can also use items currently in the shop.\r\n\r\nHet kopen van meubels: Blader naar het item dat u wilt kopen op de Marketplaats offers pagina en klik op Kopen. Wij garanderen u dat het item op de goedkoopste prijs beschikbaar zijn op het moment van aankoop te krijgen.'),
(11, 10, 'Mijn Verkoop', 70, '1', '1', 1, 0, 1, '', 'marketplace_own_items', '', ''),
(12, 10, 'Offers', 71, '1', '1', 1, 0, 2, 'marketplace_offers', 'marketplace', '', ''),
(13, -1, 'Rabbit Exchange', 146, '1', '1', 1, 0, 26, '', 'default_3x3', 'catalog_bank_headline1|catalog_bank_teaser', 'Je kunt je Rabbit credits hier ruilen voor Exchange meubelen, die u in een handel kan gebruiken of gewoon ruilen voor werkelijke credits. |'),
(14, -1, 'Dieren Shop', 8, '1', '1', 1, 0, 22, 'pets_shop', 'pets3', 'catalog_pet_headline1|ctlg_pet_note', 'Pets are inhabitants of Habbo Hotel too so each pet owner needs to know a bit about them. If you want to look after your pet properly, make sure you read the following points carefully.|A few things you should know:|*You can place a pet in your room or take one for a walk with you in other rooms.\r\n*You can''t trade your pet but they can follow you to friend''s rooms to gather scratches.\r\n*You can have up to 50 pets in your room, but look after them all!\r\n\r\n\r\n*Look after your pet with food, water and treats. Check the Pets'' Accessories.\r\n*Unlock Badges en prestaties door het trainen van uw huisdier|. Klik op uw huisdier en druk op de "Train" knop om een ??lijst met opdrachten die het niveau van je huisdier in een mum van tijd te krijgen!'),
(15, 9020, 'Spaces', 225, '1', '1', 1, 0, 14, 'set_pixelnew', 'spaces_new', 'catalog_spaces_headline1|', 'Vloeren, wallpapers en landschappen - krijgen een groovy combinatie voor uw kamer! Gebruik de onderstaande onze steekproef ruimte om te proberen voordat je koopt! Selecteer uw favoriete ontwerpen en kleuren en klikt  op Koop!|'),
(16, -1, 'Limited Rares', 145, '1', '1', 1, 0, 9, '', 'default_3x3', 'limited_header|', 'Krijg hen terwijl zij heet zijn! Limited Edition Rare Meubel is alleen beschikbaar in beperkte hoeveelheden en zodra we zijn uitverkocht, zijn ze weg! Elke Meubel kan worden geïdentificeerd door zijn unieke ID-nummer en de LTD logo naast hen!|'),
(18, -1, 'Nieuwe Meuels', 2, '0', '0', 1, 0, 12, '', 'default_3x3', 'catalog_frontpage_headline2_en|', '|'),
(19, 9021, 'Cinema 2013', 136, '1', '1', 1, 0, 54, '', 'default_3x3', 'cinema_catalogheader|movie_catalog_teaser', 'Helemaal uit RabbitWood ... Alles wat je zou kunnen en meer nodig heeft om uw eigen film magie in een home theater te maken!|'),
(20, -1, 'Kleding', 74, '1', '1', 1, 0, 6, '', 'default_3x3', 'clothing_catalog_header|tradeableclothing_teaser', 'De geheel nieuwe Rabbit Couture verhandelbare kleding en accessoires serie is een stuk boven de rest! Van stijlvolle tops en jeans, tot verbazingwekkende accessoires en haar. Rabbit Couture laat je jezelf te uiten tot het uiterste!'),
(21, 9049, 'Gnomes', 200, '1', '1', 1, 0, 5, 'xmas14_gnome', 'default_3x3', 'xmas14_catalog_header|xmas14_gnome_teaser', 'De Noordpool kan een moeilijke plek voor een beetje Gnome, dus dit jaar hebben ze gemigreerd naar de zonnige kusten van Rabbit Islands. Voed ze, train ze en treate ze met zorg...'),
(22, 9021, 'Nieuw Jaar 2015', 2014, '1', '1', 1, 0, 156, '', 'default_3x3', '2015_header|catalog_2015_header', ''),
(24, 9020, 'Windows', 218, '1', '1', 1, 0, 20, '', 'default_3x3', 'ctlg_windows_headline1_en|ctlg_windows_teaser1_en', 'Laten we wat licht in! Onze ramen zijn er in vele unieke stijlen om een opwindende uitstraling aan uw kamer. Koop landschappen om te gaan met uw ramen van de pagina''Spaces''!|'),
(26, 9020, 'Moodlights', 40, '1', '1', 1, 0, 4, '', 'default_3x3', 'catalog_dimmers_header_en|dimmers_teaser', 'Ons assortiment van Sfeerlampjes u toelaten om de sfeer te controleren en te transformeren uw kamer in slechts een klik. Wat zal uw kamer eruit? Klik op de schakelaar en ontdek nu!|'),
(27, 9021, 'Kerstmis', 168, '1', '1', 1, 0, 56, '', 'default_3x3', 'catalog_xmas_headline1|xmas2009_catalogue', 'Krijg je in de kerstsfeer met onze selectie van feestelijke Meubi! Van snuisterijen tot poo rendieren, we hebben het allemaal!|'),
(28, 9021, 'Arctic', 13, '1', '1', 1, 0, 14, '', 'default_3x3', 'catalog_arc_header1_en|catalog_arc_teaser1_en', 'Houd het hoofd koel (of warm met onze kampvuur!) En maak je eigen Winter Wonderland of Humble Homeland voor de pinguïns.|'),
(29, 9020, 'Teleporters', 120, '1', '1', 1, 0, 16, '', 'default_3x3', 'catalog_doors_headline1|catalog_teaser_teleporters', 'Neem je kamer naar een geheel nieuw niveau met ons assortiment van space age teleporters! Koop gewoon een paar, zet een in elke kamer en voila! Je moet twee gekoppelde kamers!|'),
(30, 9021, 'Mode', 39, '1', '1', 1, 0, 144, '', 'default_3x3', 'catalog_mode_headline1|catalog_mode_teaser1', 'Steely, grijs, industriële standaard metaal met een strak design. De perfecte reeks voor een streetwise stadsmens.|'),
(31, 9021, 'Candy', 19, '1', '1', 1, 0, 42, '', 'default_3x3', 'catalog_candy_headline1|catalog_candy_teaser1', 'Een beetje meer vrouwelijke dan ''Mode'', zal dit een beetje glamour en glitter toe te voegen aan uw kamer. Bij gebrek aan een paar items? Hoofd op over aan de categorie ''Mode''!|'),
(32, 9021, 'Pura', 48, '1', '1', 1, 0, 176, '', 'default_3x3', 'puraheader|catalog_pura_teaser1', 'De schoonste en verste bereik. U kunt bijna oran ademen koel en rust in je kamer. Gebruik het om een toevluchtsoord, weg van de hectische levensstijl van Rabbit Hotel te maken.|'),
(33, 9021, 'Area', 14, '1', '1', 1, 0, 16, '', 'default_3x3', 'catalog_area_headline1|catalog_area_teaser1', 'Een dikke en sofisticated lijn voor de down-to -earth, leergierig Rabbit. Zijn simplicty is beautful en zal een gastvrije charme toe te voegen aan elke kamer.|'),
(34, 9021, 'Country', 21, '1', '1', 1, 0, 68, '', 'default_3x3', 'country_header1_en_001|country_teaser1', 'Laten we de drukke straten van de stad en ga naar de brede afgrond van de gouden tarwe, smaragd velden en zelfgekweekte, biologische groenten. Alles wat je nodig hebt om een ??boerderij te maken!|'),
(35, 9021, 'Lodge', 37, '1', '1', 1, 0, 130, '', 'default_3x3', 'catalog_lodge_headline1|catalog_lodge_teaser1', 'Om die prachtige ski-lodge effect met een open haard en whisky op de zijbalk. Dit bereik is voor degenen die de ware schoonheid van massief hout appreicate.|'),
(36, 9021, 'Plastic', 46, '1', '1', 1, 0, 168, '', 'default_3x3', 'catalog_plasto_headline1|', 'Werpen op een afro en pak een discobal! Voel dat retro, 1970 vibe? U zult snel met deze kleurrijke, plastic bereik! Kies een kleur bij uw stemming en daar ga je aan te passen!|'),
(37, 9021, 'Lagomorph', 192, '1', '1', 1, 0, 126, '', 'default_3x3', 'catalog_header_easter14_001|catalog_lagomorph_teaser', '\r\nVan shape-shifting muur stukken om crpytic teleports, het eiland van Lagomorph Meubi lijn is zeker om u te raden! Niets is wat het lijkt op dit breinbrekende eiland...'),
(38, 9021, 'Bathroom', 17, '1', '1', 1, 0, 26, '', 'default_3x3', 'catalog_bath_headline1|catalog_bath_teaser1', 'Laten we eerlijk zijn.. Kun je niet leven zonder uw badkamer. Geef uw gasten ergens op te frissen met onze cheeful badkamercollectie!|'),
(39, 9020, 'Plants', 220, '1', '1', 1, 0, 6, '', 'default_3x3', 'catalog_plants_headline1|catalog_plants_teaser1', '\r\nElke kamer heeft wat groen, dear! Niet alleen hebben ze de kwaliteit van de lucht te verbeteren, ze op te vrolijken een kamer om het gewoon schitterend te maken! En wat een betere gift voor een vriend dan een elegante roos..|'),
(40, 9020, 'Rugs', 116, '1', '1', 1, 0, 12, '', 'default_3x3', 'catalog_rugs_headline1|catalog_rugs_teaser1', '\r\nTapijten voor alle gelegenheden, wit voor bruiloften, zwart voor begrafenissen en alles daartussenin! Alle tapijten zijn anti-slip en wasbaar in de machine. Maak uw keuze !|'),
(41, 9020, 'Posters and Flags', 219, '1', '1', 1, 0, 8, '', 'default_3x3', 'catalog_gallery_headline1|catalog_posters_teaser1', 'Versier uw muren met posters, kunst, plaques en wandkleden. Deze galerij barst van de items voor ieder wat wils, van traditionele en moderne passen!|'),
(42, 9021, 'Trophies', 60, '1', '1', 1, 0, 210, '', 'trophies', 'catalog_trophies_headline1|', 'Everyones a winner with Rabbit trophies! Now you can reward all your friends with our pre-polished array of trohpies, in bronze, silver and gold. \r\nKies eerst uw trofee model, dan is de metaal, en zorgvuldig typ uw inschrijving. Maak je geen zorgen, we doen het allemaal graveren met uw naam en de datum.|'),
(43, 9021, 'Accessories', 11, '1', '1', 1, 0, 2, '', 'default_3x3', 'catalog_extra_headline1|catalog_extra_teaser1', '\r\nMaar u wilt uw hoofdzaak te plaatsen, dat zijn de finishing touch echt een kamer en te uiten je ware persoonlijkheid. Vergeet niet, als iets anders, kunt u ze allemaal op het punt om uw stemming aan te passen bewegen! |Maar u wilt uw hoofdzaak te plaatsen , dat zijn de finishing touch echt een kamer en te uiten je ware persoonlijkheid. Vergeet niet, als iets anders, kunt u ze allemaal op het punt om uw stemming aan te passen bewegen!| Maar u wilt uw hoofdzaak te plaatsen, dat zijn de finishing touch echt een kamer en te uiten je ware persoonlijkheid. Vergeet niet, als iets anders, kunt u ze allemaal op het punt om uw stemming aan te passen bewegen!|'),
(45, 4, 'Rentals', 44, '1', '1', 1, 0, 230, '', 'default_3x3', 'catalog_pixelrent_headline1_en|catalog_pxl_teaser3_en', 'Huren van een aantal coole effecten tot een explosieve tintje aan uw kamer. Van bubbels om firestarters, kunt u uw kamer drastisch te verbeteren!|'),
(46, 5, 'HC Executive', 172, '1', '1', 1, 0, 51, '', 'default_3x3', 'catalog_header_hc|hcexec_teaser', 'Rabbit Club is terug! Met een nieuwe reeks van meubelen; HC Executive!'),
(47, 9021, 'Base', 179, '1', '1', 1, 0, 24, '', 'default_3x3', 'catalog_header_base|base_rentable_teaser', '\r\nDeze kleurrijke waaier van Meubi heeft alles wat je nodig hebt om de stijl van uw kamer en grote ruimtes te bouwen.'),
(48, 9021, 'Health Spa', 211, '1', '1', 1, 0, 112, '', 'default_3x3', 'catalog_header_spa|catalog_teaser_spa', 'Een dag in de spa! Inhale... Exhale... Inhale... Exhale. Met alle kenmerken van een premie Spa, kunt u nu uw eigen Rabbit Health Spa ontspannen toevluchtsoord! Badjas en slippers niet inbegrepen.'),
(49, 9021, 'Shakespeare', 59, '1', '1', 1, 0, 190, '', 'default_3x3', 'catalog_shakespeare_header|catalog_shakespeare_teaser', '\r\nU kunt ''s werelds meest beroemde dichter zijn! Het enige wat u hoeft te doen is de aankoop van onder de meubels, geweldig zijn in het spreken en thee drinken!'),
(50, -1, 'Duckets Shop', 178, '1', '1', 1, 0, 13, '', 'info_duckets', 'duckets_header|', '<i><b><font color="#591d97" size="16">Wat zijn Duckets?</font></b></i><br><br>Ducket is een gratis virtuele valuta die u dagelijks kunt verdienen gewoon door het spelen van Rabbit.<br><br><i><b><font color="#591d97" size="16">Wat zijn ze goed voor?</font></b></i><br><br><li><a href="event:catalog/open/rentables_spaces">Paint</a> jouw kamers.</li><li>Krijg een <a href="event:catalog/open/duckets_cat">cat</a> en <a href="event:catalog/open/duckets_petaccessories">accessories</a>.</li><li><a href="event:catalog/open/rentables_info">Rent meubels</a>.</li><li>Krijg <a href="event:catalog/open/special_effects">avatar effects</a>.</li><li>Wat leuke dingen we komen met.</li><br><i><b><font color="#591d97" size="16">Hoe krijg ik het?</font></b></i><br><br><li>Bezoek Rabbit! Krijg soms elke dag. Hoe actiever je bent, hoe meer je verdient.</li><li>Je krijgt een aantal voor elke voltooide prestatie in de <a href="event:talent/open/citizenship">burgerschap spoor</a>.</li><li>Eventuele andere verrassing kunnen we verzinnen!</li>|'),
(51, 9027, 'Extras', 28, '1', '1', 1, 0, 36, '', 'default_3x3', '', '\r\nEen creatieve bui ? Je zou moeten zijn! Hier is een volledig assortiment van bouwstenen om een ??master stuk met te creëren!'),
(52, 9020, 'Badge Display', 224, '1', '1', 1, 0, 2, '', 'badge_display', '|', '\r\nKreeg een badge die u wilt om af te pronken aan anderen ? Nu is je kans!'),
(53, 50, 'Kamer Promo', 55, '1', '1', 1, 0, 3, 'room_ad', 'roomads', 'events_header|', '||'),
(55, 9021, 'Iced', 13, '1', '1', 1, 0, 114, '', 'default_3x3', 'catalog_iced_headline1|catalog_iced_teaser1', 'De Iced gamma: Squishy, zacht en zeker cool. Wat uw behoeften, zou dit stijlvol assortiment te dekken!|'),
(56, 9021, 'Alhambra', 12, '1', '1', 1, 0, 6, '', 'default_3x3', 'catalog_alh_headline1_en|dining_area_illustration', '\r\nVoor de koude Arabische nachten en warme Arabische dagen , zult u een paleis nodig hebt .. En we hebben net wat je nodig hebt ! Green bloesem druk moet betrekking hebben op het prima ! |'),
(57, 9021, 'Asian', 15, '1', '1', 1, 0, 18, '', 'default_3x3', 'catalog_asian_headline1|catalog_asian_teaser1', '\r\n\r\nTing tong! Ching chong? Ting Ting chong, ping ping! Ik bedoel, uh.. met onze authentieke Chinese meubelen, kunt u een prachtige oosterse ruimte te maken!|'),
(58, 9021, 'Bensalem', 18, '1', '1', 1, 0, 28, '', 'default_3x3', 'catalog_lc_headline2_en|catalog_lc_teaser1_en_001', 'Onder de seaaaaaaaaa, oh, onder de seaaaaaa! Wat zal uw onderwaterwereld eruit? We hebben het allemaal hier, krabben, koreal, en mythische zeedieren!|'),
(59, 9021, 'Easter 2011', 25, '1', '1', 1, 0, 80, '', 'default_3x3', 'catalog_easter_headline1|catalog_easter_teaser1', 'Kleine vogeltjes uitbroeden van hun eieren, mooie  sierlijke bloemen bloeien en schattige konijnen bouncy in het voorjaar weiden.. Het is Pasen!|'),
(60, 9021, 'Executive', 27, '1', '1', 1, 0, 86, '', 'default_3x3', 'catalog_exe_headline1_en|catalog_exe_teaser_en', '\r\n\r\n\r\nVoor de ultieme zakelijke man, de Executive bereik met zijn lederen zetels en Italiaanse koffie is een droom  Hoe zit het met je probeert de eenvoudige levensstijl?|'),
(61, 9021, 'Glass', 29, '1', '1', 1, 0, 92, '', 'default_3x3', 'catalog_glass_headline1|catalog_glass_teaser1', 'Je kunt echt het openen van een ruimte met deze stijlvolle glazen meubels, gewoon niet lopen in het!|'),
(62, 9021, 'Gothic', 30, '1', '1', 1, 0, 94, '', 'default_3x3', 'catalog_gothic_headline1|catalog_gothic_teaser1', '\r\nAls de kerkklokken luiden middernacht, loopt u door uw geplaveide hal verlicht door kaarsen, stort je in je middeleeuwse troon en verf je nagels zwart. Dit is wat wij dachten toen we bestelden dit bereik !|'),
(63, 9021, 'Sports', 56, '1', '1', 1, 0, 196, '', 'default_3x3', 'sports|catalog_sports_teaser1', 'Sport bevat al die vitale Olympische stukken uit atletiekbaan tot basketbalvelden! 3, 2, 1, GO!|'),
(64, 9021, 'Grunge', 32, '1', '1', 1, 0, 98, '', 'default_3x3', 'catalog_grunge_headline1|catalog_gru_teaser_en', '\r\nBlote hemel slapen ? Maak de straten een beetje draaglijker te maken met onze inzameling van dakloze Meubi , Grunge ! |'),
(65, 9021, 'RabbitWood', 33, '1', '1', 1, 0, 110, '', 'default_3x3', 'habbowood|ctlg_limited_teaser1', 'Geen flits fotografie , schat ! Dit bereik is alleen voor de VIP Hollywood-acteurs ! |'),
(66, 9021, 'Rabbitween 2011', 34, '1', '1', 1, 0, 102, '', 'default_3x3', 'catalog_halloween_headline1|catalog_voodoo_teaser', 'WooOOOOoooOOoo ! Spookachtig! Wil niet blijven zitten met deze range ''s nachts .. wie weet wat er zou gebeuren ! |'),
(67, 9021, 'Japan', 36, '1', '1', 1, 0, 120, '', 'default_3x3', 'catalog_jap_headline1|catalog_jap_teaser3_en', '\r\n\r\nWe hebben sushi, tatami en katana ''s! Ik heb geen idee wat het verschil is, maar ik weet zeker dat haar Japanse! Vervul je fantasieën en koop wat vandaag!|'),
(68, 9021, 'Lost Tribe', 38, '1', '1', 1, 0, 132, '', 'default_3x3', 'losttribe|LT_teaser_en', '\r\nStart je eigen tribal dorp met onze antieke meubels, alles gesneden uit slijtvast steen. LET OP: Lava is heet, krijgen een volwassene om je te helpen|.'),
(69, 9021, 'Neon', 41, '1', '1', 1, 0, 152, '', 'default_3x3', 'catalog_neon_header1_en|catalog_neon_teaser1_en', '\r\nNieuwJaar, verjaardagen en elke andere dag van het jaar, is er altijd een excuus voor een feestje! Dus, waarom ga je niet wat Neon Meubi kopen ?|'),
(71, 9021, 'Relax', 49, '1', '1', 1, 0, 180, '', 'default_3x3', 'rela_header_en|rela_teaser_en', '\r\nOntspannen na een drukke dag in de Welcome Lounge. Steek een paar kaarsen , en chill out met een goed boek in een rieten stoel . We begrijpen de behoeften van een konijn met een hectisch leven ! |'),
(72, 9021, 'Romantique', 50, '1', '1', 1, 0, 182, '', 'default_3x3', 'catalog_romantique_headline1|catalog_rom_teaser_en', '\r\nGevonden in een Franse schuur , deze lieve maar sexy romantische range is geschikt voor iedere dames behoeften. Gewoon naar mijn neus poederen ! |'),
(73, 9021, 'Science Fiction', 53, '1', '1', 1, 0, 188, '', 'default_3x3', 'sf_header_en|sf_teaser_en', 'Blipblop blip blip blip.. Oooh.. what''s this button do?.. You can find out exactly what it does with our new Scifi range, batteries included!|'),
(74, 9021, 'Shalimar', 54, '1', '1', 1, 0, 192, '', 'default_3x3', 'catalog_shal_header1_en|catalog_shal_teaser_en', 'Everyone loves Bollywood! Watch out for rose petals!|'),
(75, 9021, 'Summer', 57, '1', '1', 1, 0, 204, '', 'default_3x3', 'summer|catalog_teaser_dragons', 'Phwoar! Start up the barbie! This range has everything you need for the perfect summer garden!|'),
(76, 9021, 'Valentines', 144, '1', '1', 1, 0, 220, '', 'default_3x3', 'catalog_header_val12_2_en|catalog_teaser_val12', 'Love is in the air once again! Buy your sweetheart a rose or whisper sweet nothings in their ear on a love sofa. Can you feel it? <3|'),
(77, 9021, 'Greek', 31, '1', '1', 1, 0, 96, '', 'default_3x3', 'greekheader|greekteaser', 'Be transported back to ancient Greece with a couple of thousand pounds and British Airways. Until then, build your own panthenon with our realist Greek range!|'),
(80, 503, 'Freeze', 87, '1', '1', 1, 0, 6, '', 'default_3x3', 'catalog_cltbs_heade r1_es|catalog_cltbs_tease r_es', 'Freeze!... and try the newest game to hit Rabbit! Team up and plant snowball bombs to snap freeze your competitors. You could say it''s so cool, it''s frozen ;)'),
(85, 91, 'Collectibles', 28, '1', '1', 5, 0, 6, '', 'default_3x3', 'catalog_collectibles_headline1_en|catalog_cltbs_teaser_en', 'The Pixel Collectables are the ultimate collectors items, requiring a mammoth 2000 pixels and credits to buy! If you collect all the pieces and manage to put them together in certain ways, you''ll receive a special effect!|'),
(91, -1, 'Andere Meubels', 3009, '1', '0', 5, 0, 60, '', 'default_3x3', '|', '|'),
(92, -1, 'Rare  Meubels', 3009, '1', '0', 5, 0, 50, '', 'default_3x3', '|', '|'),
(93, 91, 'Trophies', 28, '1', '1', 5, 0, 210, '', 'trophies', 'catalog_trophies_headline1|', 'This page contains special trophies available for staff to give as prizes. STAFF CAUGHT GIVING OUT THESE WITH NO REASON WILL BE DEMOTED.|'),
(94, 92, 'Rares', 28, '1', '1', 5, 0, 1, '', 'default_3x3', 'catalog_rares_headline1|raresteaser', 'Please do not give out rares to your friends or users for no reason, each purchase you make is logged for higher management to review.'),
(95, 91, 'Room Backgrounds', 28, '1', '1', 5, 0, 3, '', 'default_3x3', 'catalog_rares_headline1|raresteaser', 'This page contains special rares available for staff. STAFF CAUGHT GIVING OUT THESE WITH NO REASON WILL BE DEMOTED.|'),
(96, 91, 'Theatredome', 28, '1', '1', 5, 0, 12, '', 'default_3x3', '', ''),
(102, 9020, 'Rollers', 222, '1', '1', 1, 0, 10, '', 'default_3x3', 'catalog_roller_headline1|catalog_teaser_rollers_en', 'Zoooooooom, Zooooooooooooooooooooooooooom! Was it a plane? Was it a bird!? No, it was Danielle on a roller! You can use rollers in games, events or even just to move a queue along.|'),
(103, 9021, 'Diner', 204, '1', '1', 1, 0, 74, '', 'default_3x3', 'diner|catalog_diner_teaser_en', 'Originally from the 50''s this furni has been refurbished and put right into the catalogue! Use this with the Kitchen range for ultimate diner experience!|'),
(112, 9021, 'Twilight', 64, '1', '1', 1, 0, 212, '', 'default_3x3', 'catalog_twilight_header_en|catalog_teaser_twilight', 'I''ve never read the book, all I know is it has vampires playing basket ball and some heart throb called Edward Cullen, but the furni looks good!|'),
(120, 503, 'Battle Banzai', 78, '1', '1', 1, 0, 2, '', 'default_3x3', 'Battlebanzai|catalog_battleBanzai_teaser', 'Prepare for Battle Banzai!|'),
(123, 4, 'Hello', 35, '1', '1', 1, 0, 240, '', 'default_3x3', 'catalog_hello_header1_en|catalog_hello_teaser1_en', 'Hello Furni is available with Pixels and is perfect if you are decoreting your room for the very first time. The Furni is yours to keep and therefore cannot be traded.|'),
(126, 9021, 'Tiki', 59, '1', '1', 1, 0, 208, '', 'default_3x3', 'catalog_tiki_header1_en|tiki_teaser', 'Imagine the scene.. lost on a desert island when you stumble across a small local tribe.. now you can with our Tiki range!|'),
(128, 9021, 'Urban', 26, '1', '1', 1, 0, 216, '', 'default_3x3', 'urban_header_en|urban_teaser_en', 'New York City styled furni range, Urban is perfect for any street, alleyway or road. Rubbish bins, street lights and benches, all the Urban furniture you need!|'),
(129, 9021, 'Automobile', 16, '1', '1', 1, 0, 22, '', 'default_3x3', 'catalog_automobile_header1_en|catalog_automobile_teaser1_en', 'Every Rabbiter needs a car effect! Not only do they bring a bit of the outside inside, they also enhance the air quality! And what better gift for a friend than a beautiful traffic sign or elegant pile of tires...|'),
(134, 91, 'System', 28, '1', '1', 5, 0, 1, '', 'default_3x3', 'system1|', '|'),
(135, 9021, 'Habboween 2014', 231, '1', '1', 1, 0, 108, '', 'default_3x3', 'hween14_catalog_header|hween14_catalog_teaser', 'It''s that time of the year again, and to celebrate the spooky month we''ve released a new Habboweed furni range!'),
(136, 9021, 'Bling', 93, '1', '1', 1, 0, 34, '', 'default_3x3', 'catalog_header_bling_en|catalog_teaser_bling11', 'Bling, Bling! Flash, Flash! Want to have that real celebrity lifestyle? Well, go somewhere else, all we have here is a tacky range of furni.|'),
(137, 9021, 'Orgie', 235, '1', '1', 1, 0, 158, '', 'default_3x3', 'orgierange|', 'The latest range from Ann Summers, the Orgie line. Made of soft, wipe clean plastic, its perfect for any three, four or fivesome!|'),
(141, 14, 'Pigs', 67, '1', '1', 1, 0, 20, '', 'pets', 'catalog_pet_headline1|', 'These little scamps were destined for the dining table until we struck a deal with a local farmer to rescue their cute pigtails! Adopt your little piglet today, all you need now is a name.|Name your Pig:|Pick a Colour:|Pick a breed:'),
(142, 14, 'Dieren Accessories', 43, '1', '1', 1, 0, 30, '', 'default_3x3', 'catalog_pet_headline1|ctlg_pet_teaser1', 'This page has everything you need to give your pet the happy life it deserves. We''ve got a huge selection!|'),
(143, 9021, 'Flower Power', 73, '1', '1', 1, 0, 88, '', 'default_3x3', 'flowerpower|2828998428_1', 'Woah! Far out man... let the petals take control. Lets collaborete on a hippy hideout and plant some seeds! Lucy in the sky with diamonds style eyy?!|'),
(144, 9021, 'Runway', 74, '1', '1', 1, 0, 184, '', 'default_3x3', 'runway_header_en|runway_teaser_en', 'Spice up your salon, hair parlour or boutique with our stylish yet practical range! From sewing machines to comfy seating, we''ve got the perfect option for you.|'),
(145, 9021, 'Wedding', 238, '1', '1', 1, 0, 232, '', 'default_3x3', 'Wedding1|9efov', 'Rabbit just wouldn''t be the same without a wedding to attend every now and again!|'),
(146, 9021, 'School', 130, '1', '1', 1, 0, 186, '', 'default_3x3', 'ruletheschool_header|catalog_school_teaser', 'Sick of being told what to do? Want to be the boss of someone else for a change? Well now you can with our very own school range!|'),
