(9212, 9021, 'Halloween 2015', 262, '1', '1', 1, 0, 4, '', 'default_3x3', 'catalog_header_hw15|catalog_teaser_hw15', 'Darkness and evil is spreading through the hotel and you''re one of the ONLY Habbos that can fight the bad energy! Dodge Evil Frank, avoid dark shadowy places and make it your mission to save Rabbit Hotel from complete and TOTAL annihilation!'),
(9213, 9212, 'Clothing', 262, '1', '1', 1, 0, 1, '', 'default_3x3', 'catalog_header_hw15|catalog_teaser_hw15|hween15_clothing', 'Does your loyalty belong to the Light Guardians? Or are you intent on corrupting and destroying Rabbit Hotel with the Lost Souls? Whichever side you choose, you can dress the part with these spooktacular Rabbit Couture outfits. Which side will you choose?'),
