INSERT INTO `sollicitaties` (`id`, `naam`, `email`, `skype`, `leeftijd`, `rank`, `reden`, `ervaring`) VALUES
(1, 'Davit', 'Davit', 'DAVITTT', '15', 'Hoel Manager', 'DDDDDDDDDDDDDD', 'DDDDDDDDDDDDDD'),
(2, 'Giovanny', 'Giovanny', 'live:giovannykort', '15', 'Hoel Manager', 'Ik vind het sociale aspect aan het staff-zijn zÃ©Ã©r leuk. Je leert nieuwe mensen kennen die misschien wel een lange tijd je vrienden blijven. Daarnaast heb ik ook gewoon ontzettend veel zin om ergens in een hotel mee te draaien met de dagelijkse bezigheden. Als ik iemand kan een speler kan helpen met een probleem dan krijg ik een goed gevoel, een voldoening. Als laatste kan ik ook nog zeggen dat ik graag een baan wil omdat ik nog meer ervaring wil op doen en me zo nog kan verbeteren want iedereen, hoeveel ervaring je ook hebt, maakt nog fouten.                          ', 'Ik heb gewerkt bij Lunno hotel, daar was ik eXpert. Ik heb hier 1 maand gewerkt en ik heb het hier super naar mijn zin gehad. Ik heb het team verlaten omdat ik geen genoeg tijd had in verband met school school, ik ben alsnog wel super blij met de ervaring en de tips die ik mensen heb gegeven. \r\n                                            \r\nMijn tijd op Grabbo heb ik ook staff behaald, hier was ik namelijk Moderator. Ik heb met veel plezier veel mensen geholpen en heb ook veel hiervan geleerd.                                                                                                                                                                                                    Op Mabbo hotel heb ik ook wat ervaring op gedaan hier heb ik namelijk mensen geholpen als assistent manager.\r\n\r\nIk heb zelf ook nog 2 eigen hotels gehad, Ik noemde ze Vobba en Hobbs. Ik had hier een leuke tijd en leerde veel over eigenaar zijn.\r\nIk stopte met het hotel omdat ik geen tijd en geld meer had, jammer vond ik het wel maar ik leerde hier veel van!'),
(3, 'Faggotto', 'Faggotto', 'faggot', '50', 'Expert', '', '');
